                      },
                      {
                        "text": "\n\nRecently adapted into an advertising campaign for the prestigious Chanel brand, Hysope was resurrected in March as a three-track single following numerous online reactions. Revisiting its foundations in a seminal piece of JS Bach's repertoire, Hysope EP brings together the original InBach version, a rework by violinist Francesca Guccione, and a completely new stripped-down version. For one of Bach's most beautiful and famous chorales, Arandel searched at length for the right material for the melody. “Which\ninstrument? Which lyrics? No instruments, just voices?” He settled on a piece of music in\nwhich the body accompanies the emotional journey and leads the dance. The choir no\nlonger sings for the body of Christ, but for the body of the faithful. Sicilian composer Francesca Guccione makes her violin strings weep with emotion over the notes of the organ while constructing a new, resolutely cinematic narrative. Freed from its beats, the stripped-down version sanctifies the choir and covers the organ with an unheard celestial veil.\n\nFollow Arandel\nFacebook - "
